import React, { Component } from 'react'
import Header from '../layouts/admin/Header'

export default class Setting extends Component {
    render() {
        return (
            <div>
                <Header />
                <div classname="main-panel">
                    <Topbar />
                    <div classname="content">
                        <div classname="container-fluid">
                            <div classname="row">
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
